import React, { useState, useEffect, useContext } from 'react';
import axios from 'axios';
import SongCard from '../components/SongCard';
import { AuthContext } from '../context/AuthContext';

const Recommendations = () => {
    const { user } = useContext(AuthContext);
    const [recommendations, setRecommendations] = useState({
        content: [],
        collaborative: [],
        hybrid: []
    });
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [activeTab, setActiveTab] = useState('hybrid');

    useEffect(() => {
        const fetchRecommendations = async () => {
            try {
                setLoading(true);
                setError(null);

                // Set headers with username for our simplified auth system
                const headers = {};
                if (user && user.username) {
                    headers['x-username'] = user.username;
                }

                // Fetch all types of recommendations
                const contentPromise = axios.get('/api/recommendations/content-based', { headers });
                const collaborativePromise = axios.get('/api/recommendations/collaborative', { headers });
                const hybridPromise = axios.get('/api/recommendations/hybrid', { headers });

                const [contentRes, collaborativeRes, hybridRes] = await Promise.all([
                    contentPromise,
                    collaborativePromise,
                    hybridPromise
                ]);

                // Log the responses to debug
                console.log('Content recommendations:', contentRes.data);
                console.log('Collaborative recommendations:', collaborativeRes.data);
                console.log('Hybrid recommendations:', hybridRes.data);

                setRecommendations({
                    content: contentRes.data.recommendations || [],
                    collaborative: collaborativeRes.data.recommendations || [],
                    hybrid: hybridRes.data.recommendations || []
                });
            } catch (err) {
                console.error('Error fetching recommendations:', err);
                setError('Failed to load recommendations. Please try again later.');
            } finally {
                setLoading(false);
            }
        };

        if (user) {
            fetchRecommendations();
        }
    }, [user]);

    const handleRating = async (songId, rating) => {
        try {
            // Rate the song through the API
            if (user) {
                const headers = {};
                if (user.username) {
                    headers['x-username'] = user.username;
                }

                await axios.post('/api/users/rate',
                    { songId, rating },
                    { headers }
                );
            }

            // Update recommendations after rating
            setRecommendations(prev => ({
                content: prev.content.map(song =>
                    song._id === songId ? { ...song, userRating: rating } : song
                ),
                collaborative: prev.collaborative.map(song =>
                    song._id === songId ? { ...song, userRating: rating } : song
                ),
                hybrid: prev.hybrid.map(song =>
                    song._id === songId ? { ...song, userRating: rating } : song
                )
            }));

            // Optional: Refresh recommendations after rating
            // This could be useful to see how ratings affect recommendations in real-time
            // But may not be necessary for the demo
            // fetchRecommendations();
        } catch (err) {
            console.error('Error rating song:', err);
        }
    };

    const renderTabContent = () => {
        const currentRecommendations = recommendations[activeTab];

        if (loading) {
            return <div className="loading">Loading recommendations...</div>;
        }

        if (error) {
            return <div className="error-message">{error}</div>;
        }

        if (!currentRecommendations || currentRecommendations.length === 0) {
            return (
                <div className="no-recommendations">
                    <p>No recommendations available yet. Try rating more songs to get better recommendations!</p>
                </div>
            );
        }

        return (
            <div className="song-grid">
                {currentRecommendations.map(song => (
                    <SongCard
                        key={song._id}
                        song={song}
                        onRate={handleRating}
                    />
                ))}
            </div>
        );
    };

    return (
        <div className="recommendations-page">
            <div className="recommendations-header">
                <h2>Your Personalized Recommendations</h2>
                <p>Discover new music based on your taste and preferences</p>
            </div>

            <div className="recommendation-tabs">
                <button
                    className={`tab ${activeTab === 'hybrid' ? 'active' : ''}`}
                    onClick={() => setActiveTab('hybrid')}
                >
                    Best For You
                </button>
                <button
                    className={`tab ${activeTab === 'content' ? 'active' : ''}`}
                    onClick={() => setActiveTab('content')}
                >
                    Based on Song Features
                </button>
                <button
                    className={`tab ${activeTab === 'collaborative' ? 'active' : ''}`}
                    onClick={() => setActiveTab('collaborative')}
                >
                    Similar Listeners
                </button>
            </div>

            <div className="tab-explanation">
                {activeTab === 'hybrid' && (
                    <p>These recommendations combine both content-based and collaborative filtering for the best results.</p>
                )}
                {activeTab === 'content' && (
                    <p>These songs are recommended based on the genres, artists, and audio features similar to your favorites.</p>
                )}
                {activeTab === 'collaborative' && (
                    <p>These songs are recommended based on what other users with similar taste have enjoyed.</p>
                )}
            </div>

            <section className="recommendations-container">
                {renderTabContent()}
            </section>
        </div>
    );
};

export default Recommendations;
